import { Route, Routes, Link } from "react-router-dom";
import AppLayout from "./layout/AppLayout";
import Landing from "./pages/Landing"; // Landing이 올바른 이름인지 확인해주세요.
import Login from "./pages/user/Login";
import NotFound from "./pages/error/NotFound";
import UnAuth from "./pages/error/UnAuth";
import RequireAuth from "./components/RequireAuth";
import Test from "./pages/test/Test";
import Review from "./pages/review/Review";

const ROLES = {
  ROLE_USER: 1,
  ROLE_ADMIN: 2,
  ROLE_SYSTEM: 3,
};

function App() {
  return (
    <AppLayout>
      <Routes>
        {/* 리뷰 페이지로 가는 링크 추가 */}
        <Route path="/" element={<Landing />} />
        <Route path="/test" element={<Test />} />
        <Route path="/review" element={<Review />} /> {/* 리뷰 페이지 */}
        <Route path="/user/login" element={<Login />} />
        <Route path="*" element={<NotFound />} />
        <Route path="/unauth" element={<UnAuth />} />
        <Route
          path="/admin"
          element={
            <RequireAuth allowedRoles={[ROLES.ROLE_SYSTEM, ROLES.ROLE_ADMIN]} />
          }
        >
          <Route path="/admin/board" element={<div>board</div>} />
        </Route>
      </Routes>

      {/* 메인 페이지에 리뷰 페이지로 이동하는 버튼 추가 */}
      <Link to="/review">
        <button>Go to Review Page</button>
      </Link>
    </AppLayout>
  );
}

export default App;
